import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-indigo-900/70 backdrop-blur-md text-white p-4 px-8 flex justify-between items-center shadow-md">
      <h1 className="text-lg font-bold">March√©s Publics</h1>
      <div className="flex gap-6 text-sm">
        <Link to="/offres" className="hover:underline">Offres</Link>
        <Link to="/candidature" className="hover:underline">Candidature</Link>
        <Link to="/contact" className="hover:underline">Contact</Link>
        <Link to="/login" className="hover:underline font-semibold">Connexion</Link>
      </div>
    </nav>
  );
};

export default Navbar;
